    "2016-07-27T22:20:59.962687",nt"name": "condition-and-extent-of-the-natural-oyster-beds-and-barren-bottoms-in-the-vicinity-of-apal",nt"isopen":
    false,nt"url": null,nt"notes": "A survey of oyster beds in the vicinity
    of Apalachicola, FL was conducted in 1915.  The area of the oyster beds is 7,135
    acres, or 11.1 square miles, of which two-thirds support dense growth.  It is estimated
    that during the season 1914-1915 the contents of the beds were 2,627,534 bushels
    over 3 inches long and 500,629 bushels of smaller ones.  The yield for the entire
    district for 1914-1915 was about 40 percent less than for the preceding season,
    due to demand.  St. Vincent Bar, which was showing sign of depletion, was closed
    during the latter half of the 1914-15 season by order of the State shellfish commissioner.",nt"license_title":
